- input: "TEXT\x1CC00310607\x1CTEXT1\x1C\x1CF3A\x1CThis amendment is a response to
    the letter concerning the Pre-Primary Election Report, due October 14. This amendment
    resolves the discrepancy of $1500 noted in the letter.  The source of the discrepancy
    was one $1500 HSBC PAC check which was accidentally dated before the reporting
    period.  A typo of one number placed the check outside of the reporting period
    and therefore affected the totals, but the check did not appear on the proper
    Pre-Primary Report.  This amended report contains the HSBC PAC check with the
    proper date.  Because this report is the most recent report, no amendment to subsequent
    reports is necessary.  Additionally, during preparation for the October Quarterly
    report (8/7/08-9/30/08), the Boyd for Congress campaign discovered two checks
    that were omitted from the Pre-Primary Report.  These two checks (ACAPAC $5000
    and FedPAC $2500) have been included in this amended report.  No other changes
    have been made to this amended report.  As always, we appreciate the opportunity
    to resolve these issues and amend this report to comply with the wishes of the
    FEC."
